import React, {useState, createContext} from 'react';
import Record from './Record';
const data = require('../sampleSources/datasample.json')
import {RecordsProvider} from "./contextManagers/RecordsProvider"

const Records = () => {
  const data = useContext(RecordsContext);

  return (
    <RecordsProvider >
        <h4>Recent inserts</h4>
        {data.map(records => (
          <Record procedureName={data.procedureName} />
        ))}
    </RecordsProvider>
  );
};

export default Records;
